  var nextPageToken = "";

  function authenticate() {
    return gapi.auth2.getAuthInstance()
        .signIn({scope: "https://www.googleapis.com/auth/youtube.force-ssl"})
        .then(function() { console.log("Sign-in successful"); },
              function(err) { console.error("Error signing in", err); });
  }
  function loadClient() {
    gapi.client.setApiKey('GOOGLE_API_KEY');
    return gapi.client.load("https://www.googleapis.com/discovery/v1/apis/youtube/v3/rest")
        .then(function() { 
		document.getElementById('execute').style.visibility = "visible";
		document.getElementById('executeCustom').style.visibility = "visible";
		
		myVideoIds =  document.getElementById('custom-videos').value.split(" ");
		console.log(myVideoIds)
		console.log("GAPI client loaded for API");
		},
              function(err) { console.error("Error loading GAPI client for API", err); });
  }
  
  
  function loopFromCustomIds() {
	insert(myVideoIds[counter]);
    setTimeout(function() {
        counter++;
        if(counter < myVideoIds.length) {
            loopFromCustomIds(myVideoIds[counter]);
		}
    }, 3000);
  
  }
  
  function myLoop(id, nextPageToken) {
	insert(id);
    setTimeout(function() {
        counter++;
        if(counter < videoIds.length)
            myLoop(videoIds[counter], nextPageToken);
		else {
			counter = 0;
			videoIds = [];
			if (nextPageToken.length > 0) {
				list(nextPageToken);
			}
		}
    }, 3000);
  }
  
  // function to add a video to a playlist. the playlist must be accessible to the logged Youtube account.
  function insert(videoId) {
    var playlistId = document.getElementById('output-playlist').value
	return gapi.client.youtube.playlistItems.insert({
      "part": [
        "snippet"
      ],
      "resource": {
        "snippet": {
          "playlistId": playlistId, // "PLumxG_EyQwNYS4bwN6d26EnDWBto-gNEl", PLumxG_EyQwNZ_xCeT2N7OttjQKhxh2AZ5, PLumxG_EyQwNbbPjGS4T5BUZc_s7HnEAr-
          "position": 0,
          "resourceId": {
            "kind": "youtube#video",
            "videoId": videoId
          }
        }
      }
    }).then(function(response) {
                // Handle the results here (response.result has the parsed body).
                console.log("Response", response);
              },
              function(err) { 
			  insert(videoId);
			  console.error("Execute error", err);
			  });
  }
  
  // Once the client is loaded and signed-in, adds video from a page token list, once the list is finished 
  function list(pageToken = "") {
      var channelId = document.getElementById('input-channel').value
	  return gapi.client.youtube.playlistItems.list({
		  "part": [
				"snippet",
				"id"
			  ],
			  "playlistId": channelId,
			"maxResults": 50,
			"format": "json",
			"pageToken": pageToken
	  }).then(function(response) {
		var body = JSON.parse(response.body);
		videoIds = body.items.map(e => e.snippet.resourceId.videoId);
		nextPageToken = body.nextPageToken;
		console.log("pageToken", pageToken, "next", nextPageToken);
		allVideoIds.push(videoIds);
		
		if (videoIds.length > 0) {
			myLoop(videoIds[0], nextPageToken);
		}
		
	  },function(err) { 
	  list(pageToken);
	  console.error("Execute error", err);
	  })
  }
  
  
  function execute() {
	// to use to start from a specific page token
	
	list(document.getElementById('start-page-token').value);
  }
  
    function executeCustom() {	
	// to use to upload ids specified in myVideoIds array
	loopFromCustomIds();
  }
  
  gapi.load("client:auth2", function() {
    gapi.auth2.init({client_id: CLIENT_ID.apps.googleusercontent.com,
	scope: "https://www.googleapis.com/auth/youtube.force-ssl"});
  });
</script>
